import { NavigationContainer } from "@react-navigation/native";
import { StatusBar } from "expo-status-bar";
import { View } from "react-native";
import MainContent from "./src/navigations/MainContent";

export default function App() {
  return (
    <NavigationContainer>
      <MainContent />
    </NavigationContainer>
  );
}
